import React from "react";

const PersonalLogo = () => {
  return (
    <div className="PersonalLogo row justify-content-center">
      <h2 className="h.4 logo col-12">Sobre mi Logo</h2>
      <p className="col-12">
        Mi logo se compone de dos elementos.....Por una parte el logo de trabajo
        social representado por la rueda dentada, la mano y la hoja de olivo y
        por la otra, y cómo nexo de unión, dos elementos de codigo. En concreto
        <code>curly braces</code>, dando lugar a una única <code>function</code>
        .
      </p>
      <div className="logo col-4">
        <img className="img-fluid" alt="Logo de trabajo social" src="" />
      </div>
      <div className="logo col-3"></div>
      <div className="logo col-4"></div>
    </div>
  );
};

export default PersonalLogo;
